import { Card, CardContent, Grid, Typography } from '@mui/material'
import React from 'react'

const Test = () => {

    const data = [
        {title:'THE TITLE 1', description:'This is the description 1'},
        {title:'THE TITLE 2', description:'This is the description 2'},
        {title:'THE TITLE 3', description:'This is the description 3'},
        {title:'THE TITLE 4', description:'This is the description 4'}
    ]
  return (
    <Grid container space={2} sx={{}}>
        {data.map((S, index) =>(
            <Grid item key={index} md={4} xs={12}>
                <Card>
                    <CardContent>
                        <Typography>
                            {data.title}
                        </Typography>
                        <Typography>
                            {data.description}
                        </Typography>
                    </CardContent>
                </Card>
            </Grid>
        ))};



    </Grid>
  )
}

export default Test
